import React, { Component } from 'react';

class Dashboard extends Component {

    render() {
        return (
        <div className='dashboard col-xs-8'>
            <h2 id="myDashHeader">
                My dashboard
            </h2>
        </div>
        )
    };
};
export default Dashboard;
